using System;
using System.Collections.Generic;

namespace QuickSort
{
    class Program
    {
        static void Main(string[] _)
        {
            Console.WriteLine("Váš vstup napište jako řadu čísel oddělených mezerou (příklad: 1 2 -5 9): ");
            string? inp = Console.ReadLine();

            if (inp is null){
                Console.WriteLine("Nemůžu číst konzoli...");
                return;
            }

            if (inp == "test"){ // Jenom rychlý test
                int errors;
                try
                {
                    errors = Sorter.Test();
                }
                catch{
                    Console.WriteLine("Well, jak se ti povedlo spadnout program při testu... máš svůj vlastní obdiv Jirko!");
                    return;
                }
                
                if (errors == 0){
                    Console.WriteLine("Všechny testy byly úspěšné");
                }

                else{
                    Console.WriteLine("Bylo tam " + errors + " problémů");
                }

                return;
            }

            int[] input;
            
            try{
                input = InputHandler.ConvertStringToIntList(inp);
            }
            catch{
                Console.WriteLine("Toto není validní vstup...");
                return;
            }

            Sorter.Sort(input);
            
            Console.WriteLine("Výsledek je:\n[" + String.Join(", ", input) + "]");
        }
    }

    static class InputHandler{
        public static int[] ConvertStringToIntList(string input){
            return Array.ConvertAll(input.Split(" "), int.Parse);
        }
    }

    static class Sorter
    {
        public static void Sort(int[] unsorted)
        {
            SortSection(unsorted, 0, unsorted.Length - 1);
        }

