        private static void SortSection(int[] unsorted, int l, int r)
        {
            if (l >= r) return;

            int pivot = unsorted[(l+r)>>1];
            int i = l;
            int j = r;

            while (i < j)
            {
                while (unsorted[i] < pivot) i++;
                while (unsorted[j] > pivot) j--;

                if (i < j) (unsorted[j], unsorted[i]) = (unsorted[i], unsorted[j]);
                
                if (i <= j)
                {
                    i++;
                    j--;
                }
            }

            SortSection(unsorted, l, j);
            SortSection(unsorted, i, r);
        }
    }
}
